import { createSlice } from "@reduxjs/toolkit";

const initialState = {
    MyTodoarry: []
}
const Mytodo = createSlice({
    name: "todo",
    initialState,
    reducers: {
        addtodo: (state, action) => {
            state.MyTodoarry.push(action.payload)
        }
    }

},

);
export const {addtodo}=Mytodo.actions;
export default  Mytodo.reducer;
